        <div className='home'>
            {products.map((item)=>{
                return(
                    <table>
                <tbody>
                <tr>
                    <th className='title'>Your Courses</th>
                </tr>
            <tr >
                <th>Subject</th>
                <th>Lecturer</th>
                <th>Grade</th>
            </tr>
            <tr>
                <td className='Course'></td>
                <td className='Lecturers'>Maria Anders</td>
                <td className='Grade'>F</td>
            </tr>

            </tbody>

            </table>
                )
            })}
                <div className="home__top">
                    <h2>Learning Course</h2>

            </div>

        </div>
    )
}

export default Home
